$header-borders: 1px solid black;
$header-main-background: white;
$header-top-border-bottom: 1px solid black;
$suboptions-main-border: 1px solid black;
$mobile-menu-panel-main-borders: 1px solid black;

.kng-header-nav {
    height: 100%;
    border: $header-borders;
    background: $header-main-background;

    display: flex;
    flex-flow: row wrap;
    flex: 1 0 100%;

    &__mobile {
        display: flex;
        position: relative;
        width: 10%;
        height: 100%;
        justify-content: center;
        align-content: center;
        align-items: center;

        @media (min-width: 768px) {
            display: none;
        }

        &__trigger {
            cursor: pointer;
            height: 100%;
            width: 100%;
            display: flex;
            flex-flow: row wrap;
            justify-content: center;
            align-content: center;
        }

        &__panel {
            display: flex;
            position: fixed;
            left: 0;
            top: 0;
            background: white;
            height: 100%;
            min-width: 30%;
            max-width: 50%;
            overflow: auto;
            transition: 1s;
            border: $mobile-menu-panel-main-borders;

            &--hidden {
                left: -60%;
            }

            &__menu {
                white-space: nowrap;
                overflow: auto;
                margin: 1rem;

                &__options {
                    &__item {
                        cursor: pointer;
                        margin-bottom: 1rem;
                        height: 100%;
                        cursor: pointer;

                        &__label {
                            height: 100%;
                        }

                        &__suboptions {
                            display: none;

                            &--selected {
                                display: flex;
                                flex-flow: row wrap;
                                flex: 1 0 100%;
                            }

                            &__item {
                                cursor: pointer;
                                width: 100%;
                                margin: 1rem;
                            }
                        }
                    }
                }
            }
        }
    }

    &__section {
        height: 100%;
        width: 90%;
        display: flex;
        flex-flow: row wrap;
        flex: 1 1 90%;

        @media (min-width: 768px) {
            flex: 1 0 100%;
            width: 100%;
            height: 50%;
        }

        &--top {
            border-bottom: $header-top-border-bottom;
            flex-flow: row wrap;
            justify-content: space-between;
            align-content: center;
        }

        &--bottom {
            display: none;

            @media (min-width: 768px) {
                display: flex;
            }
        }

        &__brand {
            display: flex;
            justify-content: center;
            align-content: center;
            align-items: center;
            margin-left: 1rem;
        }

        &__user {
            display: flex;
            flex-flow: row wrap;
            margin-right: 1rem;
            &__notifications {
                display: flex;
                justify-content: center;
                flex-flow: row wrap;
                align-content: center;
                align-items: center;
                &__icon {
                    height: 60%;
                    width: 60%;
                    display: flex;
                    justify-content: center;
                    align-content: center;
                    justify-items: center;
                    align-items: center;
                    img {
                        width: 100%;
                    }
                }
            }
            &__profile {
                display: flex;
                justify-content: center;
                flex-flow: row wrap;
                align-content: center;
                align-items: center;
                &__thumb {
                    height: 60%;
                    width: 60%;
                    display: flex;
                    justify-content: center;
                    align-content: center;
                    justify-items: center;
                    align-items: center;
                    img {
                        width: 100%;
                    }
                }
            }
        }

        &__options {
            display: flex;
